import styles from "./Header.module.css";
import "../../styles/common.css";

const Header = () => {
   return (
      <header>
         <div className='container'>
            <div>
               <img src='' alt='' />
               <h1>Fashion</h1>
            </div>
            <div>
               <nav>
                  <ul>
                     <li>Catalogue</li>
                     <li>Fashion</li>
                     <li>Favourite</li>
                     <li>Lifestyle</li>
                  </ul>
               </nav>
               <button>Sign up</button>
            </div>
         </div>
      </header>
   );
};

export default Header;
